        public override bool CanConvert(Type t) => t == typeof(PurpleDefault) || t == typeof(PurpleDefault?);

        public override object ReadJson(JsonReader reader, Type t, object existingValue, JsonSerializer serializer)
        {
            switch (reader.TokenType)
            {
                case JsonToken.Integer:
                    var integerValue = serializer.Deserialize<long>(reader);
                    return new PurpleDefault { Integer = integerValue };
                case JsonToken.Boolean:
                    var boolValue = serializer.Deserialize<bool>(reader);
                    return new PurpleDefault { Bool = boolValue };
            }
            throw new Exception("Cannot unmarshal type PurpleDefault");
        }

        public override void WriteJson(JsonWriter writer, object untypedValue, JsonSerializer serializer)
        {
            var value = (PurpleDefault)untypedValue;
            if (value.Integer != null)
            {
                serializer.Serialize(writer, value.Integer.Value);
                return;
            }
            if (value.Bool != null)
            {
                serializer.Serialize(writer, value.Bool.Value);
                return;
            }
            throw new Exception("Cannot marshal type PurpleDefault");
        }

        public static readonly PurplePurpleDefaultConverter Singleton = new PurplePurpleDefaultConverter();
    }

