            {
                case "":
                    return StatusDescription.Empty;
                case "The issue is resolved":
                    return StatusDescription.TheIssueIsResolved;
            }
            throw new Exception("Cannot unmarshal type StatusDescription");
        }

        public override void WriteJson(JsonWriter writer, object untypedValue, JsonSerializer serializer)
        {
            if (untypedValue == null)
            {
