            var value = (StatusDescription)untypedValue;
            switch (value)
            {
                case StatusDescription.Empty:
                    serializer.Serialize(writer, "");
                    return;
                case StatusDescription.TheIssueIsResolved:
                    serializer.Serialize(writer, "The issue is resolved");
                    return;
            }
            throw new Exception("Cannot marshal type StatusDescription");
        }

        public static readonly StatusDescriptionConverter Singleton = new StatusDescriptionConverter();
    }

