    internal class ScopeUnionConverter : JsonConverter
    {
        public override bool CanConvert(Type t) => t == typeof(ScopeUnion) || t == typeof(ScopeUnion?);

        public override object ReadJson(JsonReader reader, Type t, object existingValue, JsonSerializer serializer)
        {
            switch (reader.TokenType)
            {
                case JsonToken.String:
                case JsonToken.Date:
                    var stringValue = serializer.Deserialize<string>(reader);
                    switch (stringValue)
                    {
                        case "DueDate":
                            return new ScopeUnion { Enum = ScopeEnum.DueDate };
                        case "GLOBAL":
                            return new ScopeUnion { Enum = ScopeEnum.TypeGlobal };
                        case "TargetStartDate":
                            return new ScopeUnion { Enum = ScopeEnum.TargetStartDate };
                        case "array":
                            return new ScopeUnion { Enum = ScopeEnum.Array };
                        case "boolean":
                            return new ScopeUnion { Enum = ScopeEnum.Boolean };
                        case "global":
                            return new ScopeUnion { Enum = ScopeEnum.Global };
                        case "integer":
                            return new ScopeUnion { Enum = ScopeEnum.Integer };
                        case "json":
                            return new ScopeUnion { Enum = ScopeEnum.Json };
                        case "number":
                            return new ScopeUnion { Enum = ScopeEnum.Number };
                        case "object":
                            return new ScopeUnion { Enum = ScopeEnum.Object };
                        case "string":
                            return new ScopeUnion { Enum = ScopeEnum.String };
                    }
                    break;
                case JsonToken.StartObject:
                    var objectValue = serializer.Deserialize<SchemaElement>(reader);
                    return new ScopeUnion { SchemaElement = objectValue };
            }
            throw new Exception("Cannot unmarshal type ScopeUnion");
        }

        public override void WriteJson(JsonWriter writer, object untypedValue, JsonSerializer serializer)
        {
            var value = (ScopeUnion)untypedValue;
            if (value.Enum != null)
            {
                switch (value.Enum)
                {
                    case ScopeEnum.DueDate:
                        serializer.Serialize(writer, "DueDate");
                        return;
                    case ScopeEnum.TypeGlobal:
                        serializer.Serialize(writer, "GLOBAL");
                        return;
                    case ScopeEnum.TargetStartDate:
                        serializer.Serialize(writer, "TargetStartDate");
                        return;
                    case ScopeEnum.Array:
                        serializer.Serialize(writer, "array");
                        return;
                    case ScopeEnum.Boolean:
                        serializer.Serialize(writer, "boolean");
                        return;
                    case ScopeEnum.Global:
                        serializer.Serialize(writer, "global");
                        return;
                    case ScopeEnum.Integer:
                        serializer.Serialize(writer, "integer");
                        return;
                    case ScopeEnum.Json:
                        serializer.Serialize(writer, "json");
                        return;
                    case ScopeEnum.Number:
                        serializer.Serialize(writer, "number");
                        return;
                    case ScopeEnum.Object:
                        serializer.Serialize(writer, "object");
                        return;
                    case ScopeEnum.String:
                        serializer.Serialize(writer, "string");
                        return;
                }
            }
            if (value.SchemaElement != null)
            {
                serializer.Serialize(writer, value.SchemaElement);
                return;
            }
            throw new Exception("Cannot marshal type ScopeUnion");
        }

        public static readonly ScopeUnionConverter Singleton = new ScopeUnionConverter();
    }

